import React from 'react';
import './App.css';
import firebase from '../firebase'
import { Button, Grid, Header, Segment, Comment, Label,Image } from 'semantic-ui-react';
import HeaderPanel from './Header/header'
import SidePanelLeft from './SidePanel/SidePanelLeft'
import SidePanelRight from './SidePanel/SidePanelRight'

class App extends React.Component{

  logout = event =>{
    firebase.auth().signOut();
  }

  render(){
    return(
      <Grid>

            <HeaderPanel />
            <SidePanelLeft />
            <SidePanelRight />

          <Grid.Column style={{width: '100%' ,marginTop: '90px', marginLeft: '300px', marginRight: '300px'}}>
            <Segment>
              <Label as='a'
                color='white'
              >
                <Image avatar></Image>

              </Label>
            </Segment>
          </Grid.Column>


      </Grid>

    )
  }
}

export default App;
